import React, { useState } from 'react'
import iconPaper from '../assest/icon-paper.svg';
import iconRock from '../assest/icon-rock.svg';
import iconScissors from '../assest/icon-scissors.svg';
import { language } from '../utils/utils';

function Game() {

    const [usersChoice, setUsersChoice] = useState("");
    const [gamesChoice, setGamesChoice] = useState("")

    return (
        <div className='w-full h-max'>
            <div className='w-full h-max p-8 flex gap-36 items-center justify-center'>
                <button className='bg-white p-8 hover:p-16 rounded-full border-8 border-blue-700 shadow-lg shadow-blue-800'>
                    <img src={iconPaper} className="w-16 h-16" alt="logo" />
                </button>
                <span className='bg-white p-8 rounded-full border-8 border-orange-400 shadow-lg shadow-orange-800'>
                    <img src={iconScissors} className="w-16 h-16" alt="logo" />
                </span>
            </div>

            <div className='w-full h-max p-6 flex items-center justify-center'>
                <span className='bg-white p-8 rounded-full border-8 border-red-700 shadow-lg shadow-red-800'>
                    <img src={iconRock} className="w-16 h-16" alt="logo" />
                </span>
            </div>
        </div>
    )
}

export default Game
